import React, { useContext } from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { MotionConfig, MotionConfigContext } from 'framer-motion';

const TestMotionConfig = () => {
  const context = useContext(MotionConfigContext);
  console.log('MotionConfig Context:', context);
  return null;
};

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <MotionConfig>
      <TestMotionConfig />
      <App />
    </MotionConfig>
  </React.StrictMode>
);

